import { useState } from "react";
import Footer from "./Footer";
import Main from "./Main";
import Navbar from "./Navbar";
import Sidebar from "./Contact";

import cup from "../assets/cup.png";

function Home() {
  return (
    <div className="bg-[#774b31] h-screen relative flex items-center justify-end px-36">
      {/* White glowing circle behind the cup */}
      <div className="absolute right-20 w-64 h-64 bg-white rounded-full blur-2xl opacity-40"></div>

      {/* Cup image */}
      <img src={cup} alt="cup" className="relative w- h-72" />
    </div>
  );
}

export default Home;
